pragma solidity ^0.4.23;

import "./SafeMath.sol";
import "./Ownable.sol";

//
contract TollBoothsManager is Ownable {
	using SafeMath for uint;

    uint8 private _maxTicket;

    struct TicketTB {
        bytes32 id;
        bytes32 tollBoothId;
        string name;
        uint256 price;
        string vehicles;
        uint256 version;
        address paymentAddress;
    }
    struct RepairTB {
        string description;
        uint256 time;
        uint256 costs;
    }
    
    struct TollBooth {
        string name;
        string location;
        string description;
        uint256 investment;
        uint256 totalRevenue;
        string startTime;
        string operatorUnit;
        uint256 taxCode;
        bool activate;
    }
    struct TollBoothAdditional {
        bool completeTarget;
        uint8 numTickets;
        uint8 numAdditionalRepairs;
        mapping(uint8 => TicketTB) tickets;
        mapping(uint8 => RepairTB) additionalRepairs;
    }
    //
    mapping(uint => TollBooth) public tollBooths;
    mapping(uint => TollBoothAdditional) public tollBoothsAdditional;
    uint public totalTollBooths;
    //
    event CreateTicket(uint indexed tollBoothId, bytes32 indexed ticketId, string name, uint256 price, string vehicles, uint64 version, address paymentAddress, uint256 time);
    event TicketUpdate(uint indexed tollBoothId, bytes32 indexed ticketId, string name, uint256 price, string vehicles, uint64 version, address paymentAddress, uint256 time);
    event BuyTicket(bytes32 indexed tollBoothId );
    //
    constructor () public {
        _maxTicket = 10;
        totalTollBooths = 0;
    }
    //@
    function createNewTollBooth(
        string _name, 
        string _location,
        string _description,
        uint256 _investment,
        string _startTime,
        string _operatorUnit,
        uint256 _taxCode,
        bool _activate) public onlyOwner {
            tollBooths[totalTollBooths] = TollBooth({
                name: _name,
                location: _location,
                description: _description,
                investment: _investment,
                totalRevenue: 0,
                startTime: _startTime,
                operatorUnit: _operatorUnit,
                taxCode: _taxCode,
                activate: _activate
            });
            tollBoothsAdditional[totalTollBooths] = TollBoothAdditional({
                completeTarget: false,
                numTickets: 0,
                numAdditionalRepairs: 0
            });
            totalTollBooths++;
        }
    //@
    function getTollBoothDetails(uint id) public view returns(string, string, string, uint256, uint256, string, string, uint256, bool) {
		require(id < totalTollBooths);
        TollBooth memory tbData = tollBooths[id];
        return (tbData.name, tbData.location, tbData.description, tbData.investment, tbData.totalRevenue, tbData.startTime, tbData.operatorUnit, tbData.taxCode, tbData.activate);
	}
    //@
    function getTollBoothAdditional(uint id) public view returns(bool, uint8, uint8) {
		require(id < totalTollBooths);
        TollBoothAdditional memory tbDataAdd = tollBoothsAdditional[id];
        return (tbDataAdd.completeTarget, tbDataAdd.numTickets, tbDataAdd.numAdditionalRepairs);
    }
    //@
    /*function getTicketDetails(bytes32 _tbid, uint8 _index) public view returns(bytes32, bytes32, string, uint256, string, uint256, address) {
        require(indexOf(tollBoothsId, _tbid));
        TollBooth memory tbData = tollBooths[_tbid];
        if(tbData.numTickets <= 0)revert();
        TicketTB memory ticket = tollBooths[_tbid].tickets[_index];
        return(ticket.id, ticket.tollBoothId, ticket.name, ticket.price, ticket.vehicles, ticket.version, ticket.paymentAddress);
    }
    //@
    function getTicketDetailsFromTbid(bytes32 _tbid, uint8 _index) public view returns(bytes32, string, uint256, string, uint256, address) {
        require(indexOf(tollBoothsId, _tbid));
        TollBooth memory tbData = tollBooths[_tbid];
        if(tbData.numTickets <= 0)revert();
        TicketTB memory ticket = tollBooths[_tbid].tickets[_index];
        return(ticket.id, ticket.name, ticket.price, ticket.vehicles, ticket.version, ticket.paymentAddress);
    }

    //@
    function createTicketTB(bytes32 _tbid, string _name, uint256 _price, string _vehicles, address _paymentAddress) public onlyOwner {
            //_id = _validateId(_id);
            require(indexOf(tollBoothsId, _tbid));
            require(tollBooths[_tbid].numTickets < _maxTicket);
            bytes32 _id = keccak256(now);
            tollBooths[_tbid].tickets[tollBooths[_tbid].numTickets] = TicketTB({
                id: _id,
                tollBoothId: _tbid,
                name: _name,
                price: _price,
                vehicles: _vehicles,
                version: 1,
                paymentAddress: _paymentAddress
            });
            tollBooths[_tbid].numTickets++;
            CreateTicket(_tbid, _id, _name, _price, _vehicles, 1, _paymentAddress, now);
    }*/


 
    
